import React from "react";


const DogDetails = ({ name, age, src, facts }) => {
    return(
    <div className="Dog">
        <h4 className="Dog-name">{name}, Aged {age}</h4>
        <img src={src} alt="" className="Dog-img"></img>
        <ul>
            {facts.map((fact, index)=> (
                <li key={index}>{fact}</li>
            ))}

        </ul>

    </div>
)};

export default DogDetails;
